import React from "react";
import './about.scss';

const About = () => {
    return (
        <div className="about">
            <div>
                <div className='profile'></div>
                <p className="intro">
                    Hello! I'm Soomin.<br/>

                </p>
            </div>
        </div>
    );
};

export default About;
